        // function for elements
        function elementExists(element) {
            return (typeof(element) != 'undefined' && element != null);
        }

        // function to reshow page after it's been themed
        var resetHelpView = function(internalIframe) {
            internalIframe.style.display = 'none';
            // bring page to back to display after we know the background color is changed
            setTimeout(function() {
                internalIframe.style.display = '';
            }, slowDelay);
        };

        // variables
        var helpNotCached = window.Android.getAndroidString('helpNotCached');

        // iframe needs visual changes
        checkForIFrame = setInterval(function() {
            var iframe = document.getElementById(iframeId);
            var iframeDoc = iframe.contentDocument;

            if (elementExists(iframe) && iframeDoc != null) {
                clearInterval(checkForIFrame);
                iframe.style.display = 'none';

                // set the loading gif type behind the iframe
                var iframeDiv = document.querySelector(iframeDivSelector);
                var pageTheme = document.body.classList.contains('black') ? 'dark' : 'light';
                iframeDiv.style.background = "url('https://npwuscdn-onenote.azureedge.net/ondcnotesintegration/img/loading-"+pageTheme+".gif') no-repeat fixed center";

                // reset display from nav buttons/input
                var allNav = document.querySelectorAll('#f1NavBack, #f1NavHome');
                for (let i = 0; i < allNav.length; i++) {
                    allNav[i].onmouseup = function() {
                        resetHelpView(iframe);
                    };
                }
                var searchButton = document.querySelector('#ocSearchButton');
                var searchBox = document.querySelector('#ocSearchBox');
                searchButton.onmouseup = function() {
                    if (!searchBox.value) return;

                    resetHelpView(iframe);
                };
                searchBox.addEventListener("keypress", function(e) {
                    if (e.keyCode == 13) {
                        if (!searchBox.value) return;

                        resetHelpView(iframe);
                    }
                });

                // must listen for page load to change style
                iframe.onload = function() {
                    // display errors when the iframe can't load a page
                    try {
                        var doc = iframe.contentDocument || iframe.contentWindow.document;
                        var html = doc.body.innerHTML;

                        var innerDocument = frames[0].document;

                        // activate the MS Support Modern CSS (improves light theme, and fixes dark theme)
                        var msSupportModernStyle = document.createElement('style');
                        msSupportModernStyle.type = 'text/css';
                        msSupportModernStyle.innerHTML = msSupportModernCss + fadeInCss;
                        innerDocument.head.appendChild(msSupportModernStyle);
                        // make help page lose display
                        var allLinks = innerDocument.querySelectorAll('a');
                        for (let j = 0; j < allLinks.length; j++) {
                            allLinks[j].onmouseup = function() {
                                resetHelpView(iframe);
                            };
                        }
                    } catch(err) {
                        // notify the user and return to the original page
                        alert(helpNotCached);
                        iframe.contentWindow.location.href = iframe.src;
                    }

                    // small delay so the remaining end of the theme 'flash' isn't seen
                    document.body.classList.add('fade-in-AlienDrew'); // animate opacity as fade before showing page
                    resetHelpView(iframe);
                    setTimeout(function() {
                        window.Android.webViewSetVisible(true);
                    }, fastDelay);
                };

                // reload needed for first time load
                var originalURL = iframe.src;
                iframe.src = '_blank';
                iframe.src = originalURL;
            } else alert(helpNotCached);
        }, fastDelay);

        // continue with website related theme fixes
        var node = document.createElement('style');
        node.type = 'text/css';
        node.innerHTML = themeBaseCss;
        document.head.appendChild(node);

